import { ImageToPng } from '..';

describe('ImageToPng', () => {
  const imageToPng = new ImageToPng();

  describe('toPNG', () => {
    it('should return error when the image is not in base64', async () => {
      const orgImage = 'afas';
      const convertedImage = await imageToPng.toPNG(orgImage);
      expect(convertedImage).toEqual(Error('Provided image is not in base64 format.'));
    });
    it('should return error when unsupported image format is passed', async () => {
      const orgImage = 'data:image';
      const convertedImage = await imageToPng.toPNG(orgImage);
      expect(convertedImage).toEqual(Error('Provided image format is not supported.'));
    });
    it('should convert svg to png', async () => {
      const orgImage =
        'data:image/svg+xml;base64,';
      const convertedImage = await imageToPng.toPNG(orgImage);
      expect(convertedImage).toContain('data:image/png');
    });
    it('should convert bmp to png', async () => {
      const orgImage =
        'data:image/bmp;base64,';
      const convertedImage = await imageToPng.toPNG(orgImage);
      expect(convertedImage).toContain('data:image/png');
    });
    it('should convert icon to png', async () => {
      const orgImage =
        'data:image/x-icon;base64,';
      const convertedImage = await imageToPng.toPNG(orgImage);
      expect(convertedImage).toContain('data:image/png');
    });
    it('should convert interlaced png to png', async () => {
      const orgImage =
        'data:image/png;base64,';
      const convertedImage = await imageToPng.toPNG(orgImage);
      expect(convertedImage).toContain('data:image/png');
    });
  });
});
